module halfAdder_Behavorial(
    input A,
    input B,
    output Sum,
    output Cout
    );
    assign Sum = A ^ B;
    assign Cout = A & B;
endmodule

modules.masked_code:
module halfAdder_Behavorial_masked(
    input A0,
    input A1,
    input B0,
    input B1,
    input rN,
    output Sum0,
    output Sum1,
    output Cout0,
    output Cout1
    );
    wire p00, p01, p10, p11;

    assign Sum0 = A0 ^ B0;
    assign Sum1 = A1 ^ B1;

    assign p00 = A0 & B0;
    assign p01 = A0 & B1;
    assign p10 = A1 & B0;
    assign p11 = A1 & B1;

    assign Cout0 = p00 ^ p01 ^ rN;
    assign Cout1 = p11 ^ p10 ^ rN;
endmodule
